import "@openzeppelin/contracts/access/Ownable.sol";
import "./HasAdmin.sol";
import "./SigVerifier.sol";

contract ChainboxProxy is Ownable, HasAdmin, SigVerifier {
    address constant ZERO_ADDRESS = 0x0000000000000000000000000000000000000000;
    uint256 public minPrice = 0.0001 ether;
    uint32 public total = 0;
    address private _collector;
    bool private _useCollector = false;

    mapping(uint128 => address) private _ownerOf;

    event Payment(
        address indexed sender,
        uint128 indexed projectId,
        uint256 indexed amount
    );

    constructor(address admin, address collector) {
        _setAdmin(admin);
        _collector = collector;
    }

    function changeAdmin(address newAdmin) external onlyOwner {
        _setAdmin(newAdmin);
    }

    modifier onlyAdminOrOwner() {
        require(
            _isAdmin(_msgSender()) || _msgSender() == owner(),
            "Only admin or owner"
        );
        _;
    }

    function setMinPrice(uint256 newMinPrice) external onlyAdminOrOwner {
        minPrice = newMinPrice;
    }

    function deployPayment(uint128 projectId, Sig memory sig) external payable {
        require(projectId != 0, "Project ID cannot be 0");
        require(msg.value >= minPrice, "Not enough payment amount");

        address _sender = _msgSender();

        if (_ownerOf[projectId] != ZERO_ADDRESS) {
            require(
                _ownerOf[projectId] == _sender,
                "You are not the owner of this project"
            );
        }

        bytes32 message = sigPrefixed(
            keccak256(abi.encodePacked(_sender, projectId))
        );

        require(_isSigner(admin(), message, sig), "invalid signature");

        if (_useCollector){
            require(_collector != ZERO_ADDRESS, "collector address is not set");
            payable(_collector).transfer(msg.value);
        }

        _ownerOf[projectId] = _sender;

        ++total;

        emit Payment(_sender, projectId, msg.value);
    }

    function ownerOf(uint128 projectId) external view returns (address) {
        return _ownerOf[projectId];
    }

    function withdrawAll() external onlyOwner {
        require(address(this).balance > 0, "Empty");
        payable(_msgSender()).transfer(address(this).balance);
    }

    function setCollectorAddress(address newCollector) external onlyOwner {
        require(newCollector != ZERO_ADDRESS, "cannot set to zero");
        _collector = newCollector;
    }

    function enableCollector(bool state) external onlyAdminOrOwner {
        _useCollector = state;
    }
}
